/**
=========================================================
* Soft UI Dashboard PRO React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/soft-ui-dashboard-pro-material-ui
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
// import Card from "@mui/material/Card";
// import Grid from "@mui/material/Grid";
// import {Link} from 'react-router-dom';
// Soft UI Dashboard PRO React components
// import SuiBox from "components/SuiBox";
// import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import { Form, Col, Button, Row  ,Table} from 'react-bootstrap';


function Sidemenu() {
    return (
        <DashboardLayout>
            <DashboardNavbar />
            <br />
            <Form>
                <Row className="mb-3" style={{ fontWeight: 'bold' }}>
                    <Form.Group as={Col} controlId="formGridEmail">
                        <Form.Label>Trasfer Type</Form.Label>
                        <Form.Select defaultValue="Choose...">
                            <option>Transfer Users From One Advisor To Another Advisor</option>
                            <option>Transfer Users From One Branch To Another Branch</option>
                        </Form.Select>
                    </Form.Group>

                    <Form.Group as={Col} controlId="formGridPassword">
                        <Form.Label>From</Form.Label>
                        <Form.Select defaultValue="Choose...">
                            <option>Select Advisor</option>
                            <option>Anuraag Advisor</option>
                        </Form.Select>
                    </Form.Group>
                </Row>


                <Row className="mb-3" style={{ fontWeight: 'bold' }}>
                    <Form.Group as={Col} controlId="formGridEmail">
                        <Form.Label>To</Form.Label>
                        <Form.Select defaultValue="Choose...">
                            <option>Select Advisor</option>
                            <option>Anuraag Advisor</option>
                        </Form.Select>
                    </Form.Group>

                    <Form.Group as={Col} controlId="formGridPassword">
                        <Button variant="primary" type="submit" style={{ margin: '30px', float: 'right', width: '500px' }}>
                            Submit
                        </Button>
                    </Form.Group>
                </Row>

            </Form>

            <hr style={{ color: 'red' }} />
            <br />

            <Table striped bordered hover size="sm">
                <thead>
                    <tr style={{backgroundColor: 'gold',textAlign:'center' ,color:'white' }}>
                        <th style={{ padding:'20px' }}>Client Id</th>
                        <th style={{ padding:'20px' }}>Name</th>
                        <th style={{ padding:'20px' }}>Mobile</th>
                        <th style={{ padding:'20px' }}>Select</th>
                    </tr>
                </thead>
            </Table>
            <Footer />
        </DashboardLayout>
    );
}

export default Sidemenu;
